import React from "react";

const Expert = () => {
  return (
    <div className="mt-8 lg:px-36 py-10 ">
      <div class="bg-glass-light backdrop-blur-md border border-glass-light shadow-lg rounded-lg p-6">
        <h2 class="text-2xl font-bold text-white">Glassmorphism Card</h2>
        <p class="text-white">
          This is a card with a glassmorphism effect using Tailwind CSS.
        </p>
      </div>
    </div>
  );
};

export default Expert;
